Every Day is a Reading Day!
In this new series, Gail Boushey reads with your students and helps them learn to read independently at home for 20 to 30 minutes at a time by teaching or reintroducing them to:

‚Ä¢ the behaviors of a reader;
‚Ä¢ why it is important to read at home;
‚Ä¢ 3 Ways to Read a Book;
‚Ä¢ how to Check for Understanding;
‚Ä¢ how to track stamina;
‚Ä¢ how to use a word collector;
‚Ä¢ how to keep track of language they love that may be used in their writing; and
‚Ä¢ correspond with you, their teacher, by taking a photo of their stamina chart and sharing what they are reading.

